/// Source : https://leetcode.com/problems/number-of-equal-count-substrings/
/// Author : liuyubobobo
/// Time   : 2021-11-16

#include <iostream>
#include <vector>

using namespace std;


/// Sliding Window
/// Time Complexity: O(n)
/// Space Complexity: O(1)
class Solution {
public:
    int equalCountSubstrings(string s, int count) {

        int res = 0;
        for(int k = 1; k <= 26; k ++){

            vector<int> f(26, 0);
            int cur_k = 0, ok_k = 0, l = 0, r = -1;
            while(l < s.size()){
                if(r + 1 < s.size() && cur_k + !f[s[r + 1] - 'a'] <= k && f[s[r + 1] - 'a'] + 1 <= count){
                    cur_k += !f[s[r + 1] - 'a'];
                    f[s[r + 1] - 'a'] ++;
                    if(f[s[r + 1] - 'a'] == count) ok_k ++;
                    r ++;
                }
                else{
                    if(f[s[l] - 'a'] == count) ok_k --;
                    f[s[l] - 'a'] --;
                    if(f[s[l] - 'a'] == 0) cur_k --;
                    l ++;
                }

                res += ok_k == k;
            }
        }
        return res;
    }
};


int main() {

    cout << Solution().equalCountSubstrings("aaabcbbcc", 3) << endl;
    // 3

    cout << Solution().equalCountSubstrings("abcd", 2) << endl;
    // 0

    cout << Solution().equalCountSubstrings("a", 5) << endl;
    // 0

    cout << Solution().equalCountSubstrings("abcdabcdabcdabcd", 4) << endl;
    // 1

    cout << Solution().equalCountSubstrings(""
    , 1) << endl;
    // 779675

    return 0;
}
